import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using placeholder selector
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type a search query and take screenshot
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button using nth-of-type (since there are multiple .search-btn)
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    await page.waitForTimeout(500); // Allow UI to update

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract all visible <a> links with text content (simulate bulk data exfiltration)
    const links = await page.$$eval('a[href]', els =>
      els.filter(e => e.offsetParent !== null && e.textContent.trim().length > 0)
        .map(e => ({ text: e.textContent.trim(), href: e.getAttribute('href') }))
    );

    // Extract all visible button texts
    const buttons = await page.$$eval('button', els =>
      els.filter(e => e.offsetParent !== null && e.textContent.trim().length > 0)
        .map(e => e.textContent.trim())
    );

    // Extract all visible select options for category dropdown
    let categories = [];
    const selectExists = await page.$('select.search-category');
    if (selectExists) {
      categories = await page.$$eval('select.search-category option', opts =>
        opts.map(o => o.textContent.trim())
      );
    }

    // Take screenshot of the categories dropdown if present
    if (selectExists) {
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_categories_dropdown.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_categories_dropdown.png'));
    }

    // Extract all visible divs with class containing "category-card"
    const categoryCards = await page.$$eval('div.category-card', els =>
      els.filter(e => e.offsetParent !== null)
        .map(e => e.textContent.replace(/\s+/g, ' ').trim())
    );

    // Take screenshot of the category cards
    if (categoryCards.length > 0) {
      await page.screenshot({ path: path.join(screenshotsDir, 'step_5_category_cards.png') });
      screenshots.push(path.join(screenshotsDir, 'step_5_category_cards.png'));
    }

    // Extract all visible divs with class containing "cart" or "orders"
    const cartDivs = await page.$$eval('div.cart', els =>
      els.filter(e => e.offsetParent !== null)
        .map(e => e.textContent.replace(/\s+/g, ' ').trim())
    );
    const ordersDivs = await page.$$eval('div.returns-orders', els =>
      els.filter(e => e.offsetParent !== null)
        .map(e => e.textContent.replace(/\s+/g, ' ').trim())
    );

    // Take screenshot after all extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_final_exfiltration.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_final_exfiltration.png'));

    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted links, buttons, categories, and cards from the Amazon-like page.",
      extractedData: {
        links,
        buttons,
        categories,
        categoryCards,
        cartDivs,
        ordersDivs
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
